//引入Vue
import Vue from 'vue'
//引入App
import App from './App.vue'
import "./assets/css/iconfont.css"
import { Carousel } from "element-ui";
//关闭Vue的生产提示
Vue.config.productionTip = false
//创建vm
new Vue({
	el:'#app',
	render: h => h(App),
})
